package com.yaowang.lansha.service.impl;import java.util.List;import java.util.Map;import javax.annotation.Resource;import com.yaowang.common.dao.PageDto;import com.yaowang.lansha.dao.YwUserRoomGirlDao;import com.yaowang.lansha.entity.YwUserRoomGirl;import com.yaowang.lansha.service.YwUserRoomGirlService;import org.springframework.stereotype.Service;/** * 热门美女房间  * @author  *  */@Service("ywUserRoomGirlService")public class YwUserRoomGirlServiceImpl implements YwUserRoomGirlService{	@Resource	private YwUserRoomGirlDao ywUserRoomGirlDao;		@Override	public YwUserRoomGirl save(YwUserRoomGirl entity){		return ywUserRoomGirlDao.save(entity);	}		@Override	public Integer delete(String[] ids){		return ywUserRoomGirlDao.delete(ids);	}		@Override	public Integer update(YwUserRoomGirl entity){		return ywUserRoomGirlDao.update(entity);	}		@Override	public YwUserRoomGirl getYwUserRoomGirlById(String id){		return ywUserRoomGirlDao.getYwUserRoomGirlById(id);	}		@Override	public Map<String, YwUserRoomGirl> getYwUserRoomGirlMapByIds(String[] ids){		return ywUserRoomGirlDao.getYwUserRoomGirlMapByIds(ids);	}		@Override	public List<YwUserRoomGirl> getYwUserRoomGirlList(YwUserRoomGirl entity){		return ywUserRoomGirlDao.getYwUserRoomGirlList(entity);	}		@Override	public List<YwUserRoomGirl> getYwUserRoomGirlPage(YwUserRoomGirl entity, PageDto page){		return ywUserRoomGirlDao.getYwUserRoomGirlPage(entity, page);	}	}